import React, { useState } from "react";
import { useHistory } from "react-router-dom";


export default function Books() {
    const history = useHistory();
  const [data, setData] = useState([
    { id: 1, name: "Book 1" ,imgUrl : "https://exploreyork.org.uk/wp-content/uploads/2021/06/Books-composite-1200x817.jpg"},
    { id: 2, name: "Book 2" },
  ]);

  const goToCard  =(id)=>{
    history.push(`/book/${id}`);
  }

  return (
    <div>
      {data.map((ele) => {
        return (
          <div onClick={()=>{goToCard(ele.id)}}>
            <h1>{ele.name}</h1>
          </div>
        );
      })}
    </div>
  );
}
